import React, { useState } from 'react';
import { toast } from 'react-toastify';
import { exportInventoryTemplate } from '../../utils/helpers';
import * as XLSX from 'xlsx';
import api from '../../utils/api';

const ImportExcel = ({ onClose, onSuccess }) => {
    const [file, setFile] = useState(null);
    const [loading, setLoading] = useState(false);

    const handleFileChange = (e) => {
        const selectedFile = e.target.files[0];
        if (selectedFile) {
            const validTypes = ['.xlsx', '.xls', '.csv'];
            const fileExtension = selectedFile.name.split('.').pop().toLowerCase();

            if (!validTypes.includes(`.${fileExtension}`)) {
                toast.error('Format file tidak didukung. Gunakan .xlsx, .xls, atau .csv');
                return;
            }

            setFile(selectedFile);
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (!file) {
            toast.error('Pilih file terlebih dahulu');
            return;
        }

        setLoading(true);
        try {
            const reader = new FileReader();
            reader.onload = async (evt) => {
                const bstr = evt.target.result;
                const wb = XLSX.read(bstr, { type: 'binary' });
                const wsname = wb.SheetNames[0];
                const ws = wb.Sheets[wsname];
                const json = XLSX.utils.sheet_to_json(ws, { defval: '' });

                // Map/normalize rows to product fields
                const products = json.map(row => ({
                    sku_code: row['sku_code'] || row['SKU'] || row['Sku'] || '',
                    name: row['name'] || row['Name'] || '',
                    category: row['category'] || '',
                    animal_type: row['animal_type'] || row['animalType'] || '',
                    current_stock: row['current_stock'] || row['stock'] || 0,
                    min_stock_threshold: row['min_stock_threshold'] || row['min_stock'] || 0,
                    price_buy: row['price_buy'] || row['harga_beli'] || 0,
                    price_sell: row['price_sell'] || row['harga_jual'] || 0
                }));

                // filter out empty rows
                const filtered = products.filter(p => p.sku_code && p.name);
                if (filtered.length === 0) {
                    toast.error('Tidak ada data produk valid di file');
                    setLoading(false);
                    return;
                }

                try {
                    const res = await api.post('/products', filtered);
                    console.log('Import response', res);
                    toast.success('File berhasil diimport!');
                    onSuccess();
                } catch (err) {
                    console.error('Import failed', err);
                    toast.error('Gagal mengimpor data. Periksa file dan coba lagi.');
                } finally {
                    setLoading(false);
                }
            };
            reader.readAsBinaryString(file);
        } catch (err) {
            console.error(err);
            toast.error('Terjadi kesalahan saat membaca file');
            setLoading(false);
        }
    };

    const downloadTemplate = () => {
        try {
            exportInventoryTemplate('template_import_produk.xlsx');
        } catch (err) {
            console.error('Error generating template:', err);
            toast.error('Gagal membuat template. Pastikan package "xlsx" sudah terinstall.');
        }
    };

    return (
        <div className="modal show d-block" tabIndex="-1" style={{ backgroundColor: 'rgba(0,0,0,0.5)' }}>
            <div className="modal-dialog">
                <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title">üì§ Import Data dari Excel</h5>
                        <button type="button" className="btn-close" onClick={onClose}></button>
                    </div>

                    <form onSubmit={handleSubmit}>
                        <div className="modal-body">
                            <div className="alert alert-info">
                                <h6>üìã Format File yang Didukung:</h6>
                                <ul className="mb-0">
                                    <li>Excel (.xlsx, .xls)</li>
                                    <li>CSV (.csv)</li>
                                </ul>
                            </div>

                            <div className="mb-3">
                                <label className="form-label">Pilih File</label>
                                <input
                                    type="file"
                                    className="form-control"
                                    accept=".xlsx,.xls,.csv"
                                    onChange={handleFileChange}
                                    disabled={loading}
                                />
                                <small className="form-text text-muted">
                                    Maksimal ukuran file: 5MB
                                </small>
                            </div>

                            {file && (
                                <div className="alert alert-success">
                                    <strong>File terpilih:</strong> {file.name}
                                    <br />
                                    <small>Ukuran: {(file.size / 1024 / 1024).toFixed(2)} MB</small>
                                </div>
                            )}

                            <div className="text-center">
                                <button
                                    type="button"
                                    className="btn btn-outline-primary btn-sm"
                                    onClick={downloadTemplate}
                                >
                                    üì• Download Template
                                </button>
                            </div>

                            <div className="mt-3">
                                <h6>üìù Struktur Kolom:</h6>
                                <div className="table-responsive">
                                    <table className="table table-sm table-bordered">
                                        <thead>
                                            <tr>
                                                <th>Kolom</th>
                                                <th>Contoh</th>
                                                <th>Keterangan</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            <tr>
                                                <td>sku_code</td>
                                                <td>DOG-DRY-001</td>
                                                <td>Kode unik produk</td>
                                            </tr>
                                            <tr>
                                                <td>name</td>
                                                <td>Royal Canin Maxi Adult</td>
                                                <td>Nama produk</td>
                                            </tr>
                                            <tr>
                                                <td>category</td>
                                                <td>dry_food</td>
                                                <td>dry_food, wet_food, snack, sand</td>
                                            </tr>
                                            <tr>
                                                <td>animal_type</td>
                                                <td>dog</td>
                                                <td>dog, cat, all</td>
                                            </tr>
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>

                        <div className="modal-footer">
                            <button 
                                type="button" 
                                className="btn btn-secondary" 
                                onClick={onClose}
                                disabled={loading}
                            >
                                Batal
                            </button>
                            <button 
                                type="submit" 
                                className="btn btn-petshop"
                                disabled={loading || !file}
                            >
                                {loading ? (
                                    <>
                                        <span className="spinner-border spinner-border-sm me-2"></span>
                                        Mengimport...
                                    </>
                                ) : (
                                    'Import Data'
                                )}
                            </button>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default ImportExcel;
